import Button from '@mui/material/Button';
import Container from '@mui/material/Container'

import Appbar from './components/Appbar';

function App() {
  return (
    <div>
      <Container maxWidth="sm">
        <Appbar/>
        <Button variant="contained">Hello World</Button>
      </Container>

    </div>
  );
}

export default App;
